raide. - Šermukšnių kava 1 stiklinė džiovintų šermukšnių arba šermukšnių išspaudų, 1 stiklinė džiovintų morkų, cukrinių runkelių arba kiaulpienių, truputis - Šiltas kuskusas su vištiena 0,5 l sultinio, 300 g kuskuso, 400 g vištienos filė, 3 morkos, 2 paprikos, 100 g konservuotų pievagrybių, 2 šaukštai alyvuogių aliejaus, citrininių pipirų, šviežių - Šiltas lęšių ir ryžių užkandis 1 stiklinė rudųjų lęšių, 1 stiklinė ryžių, 4 dideli svogūnai, 4 česnakų skiltelės, 1 stiklinė aliejaus, 50 g sviesto,
..........
 sviesto, 300 g cukraus, 100 g juodojo šokolado, 6 kiaušiniai, 1 stiklinė džiovintų abrikosų, 1 šaukštas cinamono, 50 g krakmolo, 350 g miltų, 2,5 šaukštelio kepimo miltelių. - Šokoladinis ryžių pudingas 6 šaukštai ryžių dribsnių, 0,5 I pieno, 6 šaukštai cukraus, 50 g pieniško šokolado, 200 g grietinėlės, truputis citrinų rūgšties, 1 šaukštelis vanilinio - Šparagai su peletrūnų padažu ir kumpiu 500 g baltųjų šparagų, 500 g žaliųjų šparagų, 20 g sviesto, druskos, 10 g cukraus. Peletrūnų padažas;
